description.text:
A Cookie Cutter based around the curses/ascii dwarf symbol from Bay 12 Game's &quot;Dwarf Fortress&quot;  
&quot;A short, sturdy creature fond of drink and industry.&quot;... and biscuits!   
I'm doing a test print at the moment for the next batch of biscuits, but I thought I would upload this earlier in case anyone would like to try it and give me feedback onto the size, shape and ease of print of the cutter.
